Datastreams have become a prominent data model for analysing live data. A datastream is conceptually an infinite sequence of events, where an event is a data point produced by the stream at a specific moment in time. Arc-Lang provides the concept of tasks and channels to support fine grained processing of datastreams. A channel is a buffer of events which supports two basic operations. Data can be pushed and pulled into and out of the channel's buffer by tasks. In this context, a task is a lightweight thread that is executing an asynchronous function (i.e., a function that can suspend its execution). Tasks can thus await events to arrive on ingoing channels, do some processing, and emit new events onto outgoing channels. task map(i, f): (o) { loop { o ! f(receive i); }
} def main() { val stream0 = source(0..); val stream1 = map(stream0, fun(x) = x + 1);
} In the above code, map is a task which takes a stream on an input channel i, a function f, and produces a stream on an output channel o. The execution of the task enters an infinite loop which receives events from i using the receive operator, applies function f, and emits the result to o using the ! operator. The main function instantiates the task using function application syntax.

