All channels have a direction . Data can either be pushed into a channel or pulled out of it, but not both. Tasks which push data are referred to as " producers " and tasks which pull data are referred to as " consumers ". It is possible for a task to simultaneously be both a producer and a consumer, but not for the same channel. We refer to pull-only channels as streams (Stream[T]) and push-only channels as drains (Drain[T]). To make the idea more clear, consider this fully type annotated example: task map(i: Stream[i32], f: fun(i32):i32): (o: Drain[i32]) { loop { o ! f(receive i); }
} def main() { val stream0: Stream[i32] = source(0..); val stream1: Stream[i32] = map(stream0, fun(x) = x + 1);
}

