The purpose of introducing tasks and directions is to avoid deadlocks that may occur from cyclic channel-dependencies. To give an example, channels in the Go language have directions like Arc-Lang but no task-abstraction. Go instead exposes the more general concept of goroutines which are lightweight threads that can suspend execution anywhere. For example, it is possible in Go to write the following: package main func map(i <-chan int, f func(int) int, o chan<- int) { for x := range i { o <- f(x); }
} func main() { c := make(chan int); go map(c, c);
} The above code has a problem. The map function is both a consumer and producer of the same channel. This cyclic dependency causes a deadlock. In contrast, Arc-Lang restricts programs such that channels can only be created by instantiating tasks. Once a task is created its inputs cannot change. The output channel of a task cannot end up as an input channel to the same task or any upstream task. This prevents arbitrary cycles from being created in the dataflow graph, and thus prevents deadlocks. Code such as the following will result in a syntax error: task map(i, f): (o) { loop { o ! f(receive i); }
} def main() { val c = map(c, fun(x) = x + 1);
}

