Operations on streams are by default assumed to succeed without failure, but may also throw exceptions which can be handled by the user. Exceptions are thrown in two scenarios: When receiving data from a channel which has no producer and whose buffer is empty. When emitting data into a channel which has no consumers. By catching exceptions, tasks can prolong their execution beyond the lifetime of their channels. This is especially useful when tasks have multiple input and output channels, as uncaught exceptions will terminate the task. task producer(xs): (o) { for x in xs { o ! x; }
} task consumer(i) { loop { try { print(receive i); } catch Exception::Receive { print("Producer has terminated, therefore I will terminate."); return; } }
} def main() { val stream = producer([1,2,3]); consumer(stream);
} In the above code, a producer task is sending data to a consumer task over a stream. The producer terminates once it is done sending all of its data. Since there are no more tasks which can emit data into the stream (i.e., no more references to the output stream), an exception will be raised when trying to receive data from the input stream. task producer(xs): (o) { for x in xs { try { o ! x; } catch Exception::Emit { print("Consumer has terminated, therefore I will terminate."); return; } }
} task consumer(i) { for x in i { print(x); if rand() % 100 == 0 { break; } }
} def main() { val stream = producer([1,2,3]); consumer(stream);
} The above code shows the opposite scenario, where a consumer can potentially terminate and raise an exception at the producer.

