Channels in Arc-Lang are bounded which means that their buffers have a maximum capacity. It is thus important that buffers do not overflow since this would lead to undefined behavior. For example: task producer(): (o) { for x in 0.. { o ! x; }
} task consumer(i): () { for x in i.. { sleep(1s); print(i); }
} def main() { val s = producer(); consumer(s);
} In a purely push-based system, the producer would produce data at a faster rate than the consumer can keep up. This would would inevitably cause a buffer overflow in the channel. To prevent such circumstances, a channel will block its producer from pushing events if its buffer is full. Similarly, a channel will block its consumers from pulling events if its buffer is empty. This behavior is implemented by storing multiple queues inside of channels. In particular, each channel has: A push-queue of capacity P which stores promises to push data into the channel as soon as its buffer is not full. The respective producer is blocked until the promise is fulfilled. A data-queue of capacity N which stores in-flight events. A pull-queue of capacity C which stores promises to pull data from the channel as soon as its buffer is not empty. The respective consumer is blocked until the promise is fulfilled. We have that P = 1 (i.e., a channel can only have one producer), N = <dynamic>, and C = <number of consumers>. Because channels are multicast, all consumers of a channel will pull the same event sequence. To this end, an offset is stored together with each promise in the pull-queue that indicates which event in the data-queue should be pulled. Events can only be evicted from the data-queue if they have been pulled by all consumers.

