Streaming state is typically exposed explicitly by stream processors. Users need to declare the type of data they want to persistently store and insert read and write operations in their application code to access the state. In Arc-Lang, state is managed implicitly by automatically translating tasks into FSMs (Finite State Machines) that are persisted by the system. task reduce(i, f, init): (o) { var state = init; for x in i { state = f(state, x); o ! state; }
} def main() { let sum = reduce(0..100, fun(a, b): a + b, 0); let count = reduce(0..100, fun(a, _): a + 1, 0); let max = reduce(0..100, fun(a, b): if a &gt; b { a } else { b }, 0);
} The code above shows a rolling reduce task which reduces a stream using an aggregation function f, beginning at an initial state init. Note that state is always encapsulated within a task. It is not possible (as of yet) to share state between tasks. Any value sent over a channel is copied from the producer to the consumer. This allows Arc-Lang programs to be parallelised without having to consider the risk of race conditions. How values are copied is abstracted and can for example be deep (for data with interior mutability), shallow (for immutable data), or lazy (copy-on-write). CRDTs and transactional memory are under consideration for enabling shared state.

